import React from "react";
import style from "./Header.module.css"
import {NavLink} from "react-router-dom";

const Header = (props) => {
    return (
        <div className={style.header}>

            <NavLink>
                <div className={style.login}>
                    Login
                </div>
            </NavLink>
        </div>
    )
}

export default Header
